import React from "react";
import { Pie } from "recharts";

function BudgetChart(props) {
  const { newIncome } = props;

  const state = {
    labels: ["Needs", "Wants", "Financial Goals"],
    datasets: [
      {
        label: "# of votes",
        data: [50,50,50],
        backgroundColor: ["#2adece", "#dd3b79", "#ff766b"],
        borderWidth: 2,
      },
    ],
  };

  const options = {
    plugins: {
      legend: {
        display: true,
        position: "bottom",
      },
      title: {
        text: "Budget Pie Chart",
        display: true,
        fontSize: 50,
      },
    },
  };

  return (
    <div className="pie">
      <Pie data={state} options={options} />
    </div>
  );
}

export default BudgetChart;
